INSERT INTO `posts` (`id`, `post_title`, `post_body`, `post_date`, `post_category`, `post_by`, `post_thumbnail`, `post_text`, `published`, `video_link`) VALUES
(14, 'IUIU Aumni Association Chairman\'s Message', '<p><span style=\"color: rgb(51, 51, 51);\">If you are a graduate of IUIU who is yet to become a member of this association, I earnestly invite you to become a member – it is easy and inexpensive. Membership enables you to enjoy being a part of the IUIU Alumni community and related fellowship in various forms. Take advantage of the opportunity that this association offers to all Alumni of IUIU, our dear alma mater, to give our loving attention and support that she deserves for achieving greater glory and world class status. </span></p><p><br></p><p><span style=\"color: rgb(51, 51, 51);\"><span class=\"ql-cursor\">﻿</span>Be “Proud to be a IUIU Graduate!\"</span></p>', '1600645258', 5, 3, '', 'If you are a graduate of IUIU who is yet to become a member of this association, I earnestly invite you to become a member &ndash; it is easy and inexpensive. Membership enables you to enjoy being a part of the IUIU Alumni community and related fellowship in various forms. Take advantage of the opportunity that this association offers to all Alumni of IUIU, our dear alma mater, to give our loving attention and support that she deserves for achieving greater glory and world class status. \r\n\r\n\r\n\r\n\r\n﻿Be &ldquo;Proud to be a IUIU Graduate!&quot;', 1, ''),
(17, 'IUIU Alumni Association Constitution ', '<p>Download IUIU Alumni Association Constitution&nbsp;on this link<a href=\"https://www.iuiuaa.org/_assets/downloads/IUIU-Alumni-Constitution-Final.docx\" rel=\"noopener noreferrer\" target=\"_blank\"> DOWNOAD IUIU-AA CONSTIUTUON </a></p>', '1601596140', 5, 3, 'uploads/2020/10/1601596140_101986.jpg', 'Download IUIU Alumni Association Constitution&nbsp;on this link DOWNOAD IUIU-AA CONSTIUTUON', 1, ''),
(18, 'Welcome to IUIU Alumni Association ', '<p>Assalaam Alaikum warahmatullaahi Wabarakatuh. </p><p><br></p><p>A very warm welcome to all our members. We are delighted to have you here. Feel free to share with us your experience as we move towards mobilising ourselves for the good of the alumni membership. </p><p><br></p><p>Mousa Senkubuge </p><p> Executive Secretary</p>', '1624541797', 5, 21, '', 'Assalaam Alaikum warahmatullaahi Wabarakatuh. \r\n\r\nA very warm welcome to all our members. We are delighted to have you here. Feel free to share with us your experience as we move towards mobilising ourselves for the good of the alumni membership. \r\n\r\nMousa Senkubuge \r\n Executive Secretary', 1, '');
